import React from 'react'
import ContactOptions from '../Component/ContactOptions'
import CurrentCompany from '../Component/CurrentCompany'
import HomeDetails from '../Component/HomeDetails'
import '../Styles/home.css'
import { Languages } from '../Shared/Constant'
import Buttons from '../Component/Buttons'



function Home() {
  return (
    <div className="overflow-y-auto min-h-screen bg-slate-400 text-[#2f2f2f] dark:bg-gray-900 dark:text-white transition-colors duration-300">
      {/* Top Section */}
      <div className="top-home-cont px-4 md:px-16 pt-12 pb-10">
        <div className="bg-slate-200 dark:bg-gray-800 p-6 rounded-2xl shadow-xl -mt-8 transition-colors duration-300">
          <HomeDetails />
        </div>
      </div>

      {/* Middle Section - Job & Skills */}
      <div className="py-10 flex flex-col items-center gap-6 px-4 md:px-16">
        <div className="w-full bg-slate-200 dark:bg-gray-800 p-6 rounded-2xl shadow-md transition-colors duration-300">
          <CurrentCompany />
        </div>


      </div>

      {/* Bottom Section */}

    </div>
  );
}

export default Home;
